import React, { Component } from 'react'
import { Row } from 'react-bootstrap';

//Planten Pagina
export class Planten extends Component {
    // comment
    render() {
        console.log(this.props.userData.account.bio);
        return (
            <div>
                <h2>{this.props.userData.user}</h2>
                <Row>
                    <div className="col">email:</div>
                    <div className="col">{this.props.userData.email}</div>            
                </Row>
            </div>
        )
    }
}

export default Planten
